import React from 'react';
import Navbar from './components/Navbar';
import DegreeCard from './components/DegreeCard';
import ContestsCard from './components/ContestsCard';
import SearchJobs from './components/SearchJobs';
import AIResumeBuilder from './components/AIResumeBuilder';
import XclusivesCard from './components/XclusivesCard';
import BlogCard from './components/BlogCard';
import ViewProfile from './components/ViewProfile';

function App() {
  return (
    <div className="min-h-screen bg-gray-50 w-full">
      {/* Header */}
      <header className="w-full bg-white shadow-sm fixed top-0 left-0 z-50">
        <div className="max-w-[1300px] mx-auto">
          <Navbar />
        </div>
      </header>

      {/* Main Content */}
      <div className="max-w-[1300px] mx-auto px-10 py-8 mt-[60px]">
        <main>
          {/* Main Grid Layout */}
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {/* First Row */}
            <div className="mx-auto">
              <div className="w-[350px] h-[380px] mt-4">
                <DegreeCard />
              </div>
            </div>
            
            <div className="mx-auto">
              <div className="w-[400px] h-[200px] mt-4">
                <ContestsCard />
              </div>
            </div>
            
            <div className="mx-auto lg:ml-auto">
              <div className="w-[150px] h-[180px] mt-4">
                <ViewProfile />
              </div>
            </div>

            {/* AI Resume Builder */}
            <div className="mx-auto">
              <div className="w-[320px] h-[300px] mt-4">
                <AIResumeBuilder />
              </div>
            </div>

            {/* Search Jobs - Centered */}
            <div className="col-span-1 md:col-span-2 lg:col-span-3">
              <div className="w-[500px] h-[180px] mt-6 mx-auto">
                <SearchJobs />
              </div>
            </div>

            {/* Bottom Row */}
            <div className="mx-auto">
              <div className="w-[320px] h-[200px] mt-6">
                <XclusivesCard />
              </div>
            </div>
            
            <div className="mx-auto">
              <div className="w-[400px] h-[200px] mt-6">
                <BlogCard />
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default App;
